import React from "react";

import "./Download.css";

import playStore from "../../assets/playstore.svg";

const Download = () => {
  return (
    <div id="download">
      <button className="downloadBtn">
        <img src={playStore} alt="get it on android" /> Download
      </button>
    </div>
  );
};

export default Download;
